import React from "react";

export default function ProgressBar({ currentDisplayedQuestionNumber }) {
  return (
    <div className="progress-bar-container">
      <div className="progress-bar">
        <div
          className="colored-bar"
          style={{ width: `${7 * currentDisplayedQuestionNumber}` }}
        ></div>
      </div>
      <div className="progress-bar-details">
        <p>Question {currentDisplayedQuestionNumber} </p>
        <p>0/280</p>
      </div>
    </div>
  );
}
